/**
 * @typedef {import('estree').ImportSpecifier} ImportSpecifier
 * @typedef {import('estree').ImportDefaultSpecifier} ImportDefaultSpecifier
 * @typedef {import('estree').ImportNamespaceSpecifier} ImportNamespaceSpecifier
 * @typedef {import('estree').ExportSpecifier} ExportSpecifier
 *
 * @param {Array<ImportSpecifier | ImportDefaultSpecifier | ImportNamespaceSpecifier | ExportSpecifier>} specifiers
 * @returns {import('estree').ObjectPattern}
 */
export function specifiersToObjectPattern(specifiers: Array<ImportSpecifier | ImportDefaultSpecifier | ImportNamespaceSpecifier | ExportSpecifier>): import('estree').ObjectPattern;
export type ImportSpecifier = import('estree').ImportSpecifier;
export type ImportDefaultSpecifier = import('estree').ImportDefaultSpecifier;
export type ImportNamespaceSpecifier = import('estree').ImportNamespaceSpecifier;
export type ExportSpecifier = import('estree').ExportSpecifier;
